import React from "react";
import "./ScoreBoard.css";

function ScoreBoard({ scores }) {
  return (
    <table border="1">
      <thead>
        <tr>
          <th>날짜</th><th>시간</th><th>홈팀</th><th>점수</th><th>원정팀</th><th>경기장</th>
        </tr>
      </thead>
      <tbody>
        {scores.map((game, index) => (
          <tr key={index}>
            <td>{game.date}</td><td>{game.time}</td><td>{game.home_team}</td>
            <td>{game.home_score} - {game.away_score}</td>
            <td>{game.away_team}</td><td>{game.stadium}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default ScoreBoard;
